import React from 'react';


const FeaturedProducts = ({children}) => {
  return (

    <div className='contact'>
<h1>Contact us</h1>
<h2>Inquiries? Fill out your personal information and your question here and we'll get back to you ASAP.</h2>
<form action="submit" className='contact-form'>


     <section>
    <label htmlFor="name" className='form-input'>Name</label>
    <input type="text" id='name'/>
</section>
  <section>
    <label htmlFor="email" className='form-input'>E-mail</label>
    <input type="text" id='email'/>
</section>
  <section>
        <label htmlFor="message" className='form-input'>Reason for contacting</label>
    <input type="text" id='message'/>
</section>
</form>
    </div>
  );
};

export default FeaturedProducts;
